backend.tf.code:
terraform {
  backend "s3" {
    bucket     = "cloud-ai-demo-infra"
    key        = "cloud-ai/cicd-agent.tfstate"
    region     = "us-east-1"
    encrypt    = true
    # Optionally enable DynamoDB for state locking
    # dynamodb_table = "my-lock-table"
  }
}

./module/vpc/main.tf.code:
resource "aws_vpc" "main" {
  cidr_block = var.cidr_block

  tags = {
    Name = "cloud-ai-vpc"
  }
}

resource "aws_subnet" "public" {
  count                   = length(var.public_subnets)
  vpc_id                  = aws_vpc.main.id
  cidr_block              = var.public_subnets[count.index]
  map_public_ip_on_launch = true

  availability_zone = data.aws_availability_zones.available.names[count.index]

  tags = {
    Name = "cloud-ai-public-subnet-${count.index}"
  }
}

resource "aws_internet_gateway" "gw" {
  vpc_id = aws_vpc.main.id

  tags = {
    Name = "cloud-ai-igw"
  }
}

resource "aws_route_table" "public" {
  vpc_id = aws_vpc.main.id

  route {
    cidr_block = "0.0.0.0/0"
    gateway_id = aws_internet_gateway.gw.id
  }

  tags = {
    Name = "cloud-ai-public-route-table"
  }
}

resource "aws_route_table_association" "public" {
  count          = length(var.public_subnets)
  subnet_id      = aws_subnet.public[count.index].id
  route_table_id = aws_route_table.public.id
}

resource "aws_security_group" "default" {
  name   = "default"
  vpc_id = aws_vpc.main.id

  ingress {
    from_port       = 0
    to_port         = 0
    protocol        = "-1"
    cidr_blocks     = ["0.0.0.0/0"]
  }

  egress {
    from_port       = 0
    to_port         = 0
    protocol        = "-1"
    cidr_blocks     = ["0.0.0.0/0"]
  }

  tags = {
    Name = "cloud-ai-default-sg"
  }
}

./module/vpc/variables.tf.code:
variable "cidr_block" {
  description = "The CIDR block for the VPC"
  type        = string
}

variable "public_subnets" {
  description = "The list of public subnet CIDR blocks"
  type        = list(string)
}

data "aws_availability_zones" "available" {}

./module/vpc/outputs.tf.code:
output "vpc_id" {
  value = aws_vpc.main.id
}

output "public_subnet_ids" {
  value = aws_subnet.public.*.id
}

output "default_security_group_id" {
  value = aws_security_group.default.id
}

./module/ec2/main.tf.code:
resource "aws_launch_configuration" "ec2_lc" {
  name_prefix   = "cloud-ai-lc"
  image_id      = var.ami_id
  instance_type = var.instance_type

  user_data = <<-EOF
              #!/bin/bash
              echo "Hello World! Auto Deployment from Cloud-AI" > index.html
              nohup busybox httpd -f -p ${var.server_port} &
              EOF

  lifecycle {
    create_before_destroy = true
  }
}

resource "aws_autoscaling_group" "asg" {
  name_prefix          = "cloud-ai-asg"
  launch_configuration = aws_launch_configuration.ec2_lc.name
  min_size             = var.asg_min_size
  max_size             = var.asg_max_size
  desired_capacity     = var.asg_desired_capacity
  vpc_zone_identifier  = var.subnet_ids

  health_check_type          = "ELB"
  health_check_grace_period  = 300
  force_delete               = true

  tag {
    key                 = "Name"
    value               = "cloud-ai-instance"
    propagate_at_launch = true
  }
}

resource "aws_security_group" "alb_sg" {
  name        = "cloud-ai-alb-sg"
  description = "Security group for ALB"
  vpc_id      = var.vpc_id

  ingress {
    from_port   = var.server_port
    to_port     = var.server_port
    protocol    = "tcp"
    cidr_blocks = ["0.0.0.0/0"]
  }

  egress {
    from_port   = 0
    to_port     = 0
    protocol    = "-1"
    cidr_blocks = ["0.0.0.0/0"]
  }
}

resource "aws_lb" "alb" {
  name               = "cloud-ai-alb"
  internal           = false
  load_balancer_type = "application"
  security_groups    = [aws_security_group.alb_sg.id]
  subnets            = var.subnet_ids

  enable_deletion_protection = false
}

resource "aws_lb_target_group" "tg" {
  name     = "cloud-ai-tg"
  port     = var.server_port
  protocol = "HTTP"
  vpc_id   = var.vpc_id

  health_check {
    interval            = 30
    path                = "/"
    protocol            = "HTTP"
    healthy_threshold   = 3
    unhealthy_threshold = 3
    timeout             = 5
    matcher             = "200"
  }
}

resource "aws_lb_listener" "front_end" {
  load_balancer_arn = aws_lb.alb.arn
  port              = var.server_port
  protocol          = "HTTP"

  default_action {
    type             = "forward"
    target_group_arn = aws_lb_target_group.tg.arn
  }
}

resource "aws_autoscaling_attachment" "asg_attachment" {
  autoscaling_group_name = aws_autoscaling_group.asg.id
  alb_target_group_arn   = aws_lb_target_group.tg.arn
}

./module/ec2/variables.tf.code:
variable "ami_id" {
  description = "The AMI ID for the EC2 instances"
  type        = string
}

variable "instance_type" {
  description = "The type of instance to start"
  type        = string
}

variable "vpc_id" {
  description = "The VPC ID where the resources will be deployed"
  type        = string
}

variable "subnet_ids" {
  description = "List of subnet IDs to launch resources in"
  type        = list(string)
}

variable "server_port" {
  description = "The port to use for the HTTP server"
  default     = 80
}

variable "asg_min_size" {
  description = "The minimum size of the autoscaling group"
  type        = number
}

variable "asg_max_size" {
  description = "The maximum size of the autoscaling group"
  type        = number
}

variable "asg_desired_capacity" {
  description = "The desired capacity of the autoscaling group"
  type        = number
}

variable "public_subnets" {
  description = "List of public subnets for the ALB"
  type        = list(string)
}

./module/ec2/outputs.tf.code:
output "alb_dns_name" {
  description = "The DNS name of the application load balancer"
  value       = aws_lb.alb.dns_name
}

./main.tf.code:
provider "aws" {
  region = "us-east-1"
}

module "vpc" {
  source        = "./module/vpc"
  cidr_block    = var.vpc_cidr_block
  public_subnets = var.public_subnets
}

module "ec2" {
  source          = "./module/ec2"
  ami_id          = var.ami_id
  instance_type   = var.instance_type
  vpc_id          = module.vpc.vpc_id
  subnet_ids      = module.vpc.public_subnet_ids
  asg_min_size    = var.asg_min_size
  asg_max_size    = var.asg_max_size
  asg_desired_capacity = var.asg_desired_capacity
}

./variables.tf.code:
variable "vpc_cidr_block" {
  description = "The CIDR block for the VPC"
  default     = "10.0.0.0/16"
}

variable "public_subnets" {
  description = "The list of public subnet CIDR blocks"
  default     = ["10.0.1.0/24", "10.0.2.0/24"]
}

variable "ami_id" {
  description = "The AMI ID for the EC2 instances"
  default     = "ami-0b0ea68c435eb488d"
}

variable "instance_type" {
  description = "The type of instance to start"
  default     = "t2.micro"
}

variable "asg_min_size" {
  description = "The minimum size of the autoscaling group"
  default     = 1
}

variable "asg_max_size" {
  description = "The maximum size of the autoscaling group"
  default     = 3
}

variable "asg_desired_capacity" {
  description = "The desired capacity of the autoscaling group"
  default     = 1
}

./outputs.tf.code:
output "vpc_id" {
  value = module.vpc.vpc_id
}

output "public_subnet_ids" {
  value = module.vpc.public_subnet_ids
}

output "alb_dns_name" {
  value = module.ec2.alb_dns_name
}
